def solution(stdin: str) -> str:
    n = int(stdin.split('\n')[0])
    b = [int(x) for x in stdin.split('\n')[1].split(' ')]

    # Remove duplicates
    b = list(set(b))

    # Reverse the b array and store it in a new variable
    b_reverse = b[::-1]

    # Create an empty list to store the prime numbers
    prime_numbers = []

    # Generate the prime numbers
    i = 2
    while len(prime_numbers) < len(b) // 2:
        is_prime = True
        for j in range(2, i):
            if i % j == 0:
                is_prime = False
                break
        if is_prime:
            prime_numbers.append(i)
        i += 1

    # Create an empty list to store the results
    results = []

    # Loop through the prime numbers and check if they are present in the reversed b array
    for prime in prime_numbers:
        if prime in b_reverse:
            results.append(prime)
            b_reverse.remove(prime)

    # Loop through the remaining numbers in the reversed b array and check if they have a divisor other than themselves
    for num in b_reverse:
        for i in range(2, num):
            if num % i == 0 and num // i not in results:
                results.append(num // i)
                break

    # Check if the length of the results is equal to n
    if len(results) != n:
        return "Impossible"

    # Create an empty list to store the final answer
    final_answer = []

    # Loop through the original b array and find the corresponding result
    for i in range(len(b)):
        for j in range(len(results)):
            if b[i] == results[j]:
                final_answer.append(prime_numbers[j])

    return " ".join(map(str, final_answer))

