class Coach:
    def __init__(self, team: list, k: int):
        self.team = team
        self.k = k

    def choose_team(self, students: list):
        if not students:
            return

        max_skill_student = max(students)
        max_skill_index = students.index(max_skill_student)
        left_students = students[:max_skill_index]
        right_students = students[max_skill_index+1:]

        if left_students:
            left_students = sorted(left_students, reverse=True)[:self.k]
            for student in left_students:
                student.team = self.team
                students.remove(student)

        if right_students:
            right_students = sorted(right_students, reverse=True)[:self.k]
            for student in right_students:
                student.team = self.team
                students.remove(student)

        max_skill_student.team = self.team
        students.remove(max_skill_student)

