        for i in range(1, n):
            if a[i] == a[i - 1]:
                b[i] = b[i - 1]
            elif b[i - 1] == 0 or (b[i - 1] + 1 == b[i - 2] + 2):
                b[i] = b[i - 1] + 1
            else:
