            if b[i] != b[i - 1]:
                count += 1

        return count

    def mod_pow(x, y, mod):
        res = 1
        while y > 0:
            if y & 1:
                res = res * x % mod
            x = x * x % mod
            y >>= 1
        return res

    count = count_monotonic(a)
    MOD = 998244353

    return str(mod_pow(2, count, MOD))

