def solution(stdin: str) -> str:
    n = int(stdin.split('\n')[0])
    sequence = list(map(int, stdin.split('\n')[1].split()))
    result = []

    def can_be_written_down(num: int, sequence: list) -> bool:
        if num in sequence:
            return True
        if num * 3 in sequence:
            return can_be_written_down(num * 3, sequence)
        if num // 2 in sequence:
            return can_be_written_down(num // 2, sequence)
        return False

    def find_possible_sequence(sequence: list) -> list:
        for num in sequence:
            if can_be_written_down(num, sequence):
                result.append(num)
                sequence.remove(num)
                find_possible_sequence(sequence)
                result.pop()
                break

    find_possible_sequence(sequence)
    return ' '.join(map(str, result))

