                    return False
        return True

    def shift_column(matrix: List[List[int]], col: int) -> None:
        temp = matrix[0][col]
        for i in range(n - 1, 0, -1):
            matrix[i][col] = matrix[i - 1][col]
        matrix[0][col] = temp

