        x, y = 0, 0
        for move in path:
            if move == 'L':
                x -= 1
            elif move == 'R':
                x += 1
            elif move == 'U':
                y += 1
            else:
                y -= 1
        return x, y

    def shortest_substring(s: str) -> str:
        n = len(s)
        dp = [0] * n
        for i in range(n):
            dp[i] = sum(1 for j in range(i+1) if s[j] != s[i])
        return s[dp.index(min(dp))] if min(dp) < n else -1

    t = int(stdin.readline())
