    for _ in range(t):
        n = int(stdin.readline())
        path = stdin.readline().strip()
        x, y = robot_path(path)
        result = shortest_substring(path)
        if result == -1:
            results.append(-1)
        else:
            l, r = result.find(path[0]), result.rfind(path[-1])
            results.append(f"{l+1} {r+1}")
    return "\n".join(results)

