        for move in path:
            if move == "R":
                x += 1
            else:
                y += 1
            if (x, y) in packages:
                return False
        return True

    def lexicographically_smallest_path(path1, path2):
        for i in range(min(len(path1), len(path2))):
            if path1[i] < path2[i]:
                return path1
            elif path1[i] > path2[i]:
                return path2
        return path1 if len(path1) < len(path2) else path2

    def find_shortest_path(n, packages):
        shortest_paths = []
        for i in range(n):
            for j in range(i + 1, n):
