    direction = int(stdin.split('\n')[-1])

    # Define the moves as functions
    def move_left(board):
        for row in board:
            for i in range(2):
                for j in range(3):
                    if row[j] == 0 and row[j + 1] != 0:
                        row[j], row[j + 1] = row[j + 1], row[j]
            for j in range(3):
                if row[j] == row[j + 1] and row[j] != 0:
                    row[j] *= 2
                    row[j + 1] = 0

    def move_right(board):
        for row in board:
            for i in range(2):
                for j in range(3, 0, -1):
                    if row[j] == 0 and row[j - 1] != 0:
                        row[j], row[j - 1] = row[j - 1], row[j]
            for j in range(3, 0, -1):
                if row[j] == row[j - 1] and row[j] != 0:
                    row[j] *= 2
                    row[j - 1] = 0

    def move_up(board):
        for j in range(4):
            for i in range(2):
                for k in range(3):
                    if board[k][j] == 0 and board[k + 1][j] != 0:
                        board[k][j], board[k + 1][j] = board[k + 1][j], board[k]
            for k in range(3):
                if board[k][j] == board[k + 1][j] and board[k][j] != 0:
                    board[k][j] *= 2
                    board[k + 1][j] = 0

    def move_down(board):
        for j in range(4):
            for i in range(2):
                for k in range(3, 0, -1):
                    if board[k][j] == 0 and board[k - 1][j] != 0:
                        board[k][j], board[k - 1][j] = board[k - 1][j], board[k]
            for k in range(3, 0, -1):
                if board[k][j] == board[k - 1][j] and board[k][j] != 0:
                    board[k][j] *= 2
                    board[k - 1][j] = 0

    # Execute the move function based on the direction
    if direction == 0:
        move_left(board)
    elif direction == 1:
        move_up(board)
    elif direction == 2:
        move_right(board)
    else:
        move_down(board)

    # Convert the 2D array back to a string and return it
    return '\n'.join([' '.join(map(str, row)) for row in board])

