    # Initialize a list of numbers to be crossed out
    crossed_out = [False] * (N + 1)
    # Start with the first prime number
    num = 2
    # Iterate through the remaining numbers
    while num <= N:
        # Mark all multiples of num as crossed out
        for i in range(num, N + 1, num):
            if not crossed_out[i]:
                crossed_out[i] = True
        # Find the next smallest number not crossed out
        num = N + 1
        for i in range(2, N + 1):
            if not crossed_out[i]:
                num = i
                break
        # If all numbers have been crossed out, return the answer
        if num > N:
            return str(K)
        # If we have found K numbers to be crossed out, return the answer
        if K == 1:
            return str(num)
        K -= 1

