        visited = set()
        min_tree = sum(weight for weight in graph.values())
        for i in range(n):
            visited.add(i)
            new_tree = sum(graph[(i, j)] for j in range(n) if j not in visited)
            if new_tree < min_tree:
                min_tree = new_tree
        return min_tree

    min_tree = find_min_tree(graph, n)
    result = str(min_tree) + '\n'

    for i in range(n - 1):
        for j in range(i + 1, n):
            if (i, j) in graph and graph[(i, j)] <= min_tree:
                result += f"{i} {j}\n"

    return result

