        if visited[i][j]:
            return
        visited[i][j] = True
        word += board[i][j]
        if len(word) >= 2:
            words.append(word)

        if j + 1 < cols and board[i][j + 1] != "#":
            dfs(i, j + 1, word)
        if i + 1 < rows and board[i + 1][j] != "#":
            dfs(i + 1, j, word)
        visited[i][j] = False

    for i in range(rows):
        for j in range(cols):
            if board[i][j] != "#":
                dfs(i, j, "")

    words.sort()
    return words[0]

