    N1, N2 = map(int, input_lines[0].split())
    first_row = input_lines[1]
    second_row = input_lines[2]
    T = int(input_lines[3])

    # merge the two rows
    merged_row = first_row + second_row[::-1]

    # initialize the positions of the ants
    positions = {char: i for i, char in enumerate(merged_row)}

    # simulate the jumping process
    for _ in range(T):
        new_positions = {}
        for i, char in enumerate(merged_row):
            if i == 0:
                new_positions[char] = i
                continue

            j = i - 1
            while merged_row[j] in new_positions:
                j -= 1

            if merged_row[j] < char and positions[merged_row[j]] > positions[char]:
                new_positions[merged_row[j]] = positions[char]
            elif merged_row[j] > char and positions[merged_row[j]] < positions[char]:
                new_positions[merged_row[j]] = positions[char]
            else:
                new_positions[char] = positions[char]

        positions = new_positions

    # sort the positions by their values
    result = ''.join(sorted(positions, key=positions.get))
    return result

