    for i in range(0, len(plaintext), 2):
        if i + 1 < len(plaintext):
            digraph = plaintext[i:i+2]
            row1 = key_table.index([x for x in key_table if digraph[0] in x][0])
            col1 = key_table[row1].index(digraph[0])
            row2 = key_table.index([x for x in key_table if digraph[1] in x][0])
            col2 = key_table[row2].index(digraph[1])

            if row1 == row2:
                encrypted_text += key_table[row1][(col1 + 1) % 5]
                encrypted_text += key_table[row2][(col2 + 1) % 5]
            elif col1 == col2:
                encrypted_text += key_table[(row1 + 1) % 5][col1]
                encrypted_text += key_table[(row2 + 1) % 5][col2]
            else:
                encrypted_text += key_table[row1][col2]
                encrypted_text += key_table[row2][col1]
