def solution(stdin: str) -> str:
    events = stdin.split('\n')
    stock_history = []
    average_cost = 0
    total_shares = 0
    remaining_shares = 0

    for event in events:
        words = event.split()
        if words[0] == "buy":
            shares = int(words[1])
            cost = int(words[2])
            total_shares += shares
            remaining_shares += shares
            average_cost = (average_cost * total_shares + cost * shares) / total_shares
            stock_history.append(("buy", shares, cost))
        elif words[0] == "sell":
            shares = int(words[1])
            price = int(words[2])
            profit = 0
            while shares > 0:
                if stock_history[-1][0] == "buy":
                    bought_shares, bought_cost = stock_history[-1][1], stock_history[-1][2]
                    if bought_shares <= shares:
                        profit += (price - bought_cost) * bought_shares
                        shares -= bought_shares
                        remaining_shares -= bought_shares
                        stock_history.pop()
                    else:
                        profit += (price - bought_cost) * shares
                        stock_history[-1] = ("buy", bought_shares - shares, bought_cost)
                        shares = 0
                else:
                    raise ValueError("Invalid sell event")
            average_cost = (average_cost * total_shares - profit) / total_shares
        elif words[0] == "split":
            new_shares = int(words[1])
            for i, (event_type, event_shares, event_cost) in enumerate(stock_history):
                if event_type == "buy":
                    stock_history[i] = ("buy", event_shares * new_shares, event_cost / new_shares)
            total_shares *= new_shares
        elif words[0] == "merge":
            merged_shares = int(words[1])
            for i, (event_type, event_shares, event_cost) in enumerate(stock_history):
                if event_type == "buy":
                    stock_history[i] = ("buy", event_shares // merged_shares, event_cost)
            total_shares = total_shares // merged_shares
            remaining_shares = remaining_shares // merged_shares
        elif words[0] == "die":
            if remaining_shares > 0:
                shares_sold = remaining_shares
                remaining_shares = 0
            else:
                shares_sold = 0
            total_profit = (int(words[1]) - average_cost) * shares_sold
            tax = total_profit * 0.3
            final_sale_profit = total_profit - tax
        else:
            raise ValueError("Invalid event")

    return f"{final_sale_profit:.6f}"

